// Dependencies.
import { Link } from "react-scroll";
import React from 'react';

// Component 'Navbar'.
function Navbar() {
    return (
        // Navbar Container.
        <nav className="navbar navbar-dark primary-color">
            <a className="navbar-brand" href="#">Link</a>
        </nav>
    );
}

// Do export.
export default Navbar;
